    <img src='images/Mec.jpg ' alt="" style={{ width: '10%' }} />
    <img src='images/Mec.jpg ' alt="Tech" style={{ width: '10%' }} />
    <img src='images/Mec.jpg ' alt="Tech" style={{ width: '10%' }} />
  </div>
  );
};

export default ImageGrid;
